            <TeamMember name="Eden Smith & Kieran Jones" title="ADMINISTRATION LEAD" email="mark@magdalenball.com" breaks="col-6 col-sm-4 col-lg-3"/>
            <TeamMember name="Lorenz Kipp" title="CREATIVE LEAD" email="mark@magdalenball.com" breaks="col-6 col-sm-4 col-lg-3"/>
